sol.nextGreaterElement(findNums, nums)


# 383. Ransom Note
class Solution(object):
    def canConstruct(self, ransomNote, magazine):
        """
        :type ransomNote: str
        :type magazine: str
        :rtype: bool
        """
        dict1, dict2 = [0] * 26, [0] * 26
        for j in ransomNote:
            dict1[ord(j)-ord('a')] += 1
        for i in magazine:
            dict2[ord(i)-ord('a')] += 1
        for i in range(26):
            if dict1[i] > dict2[i]:
                return False
        return True


# 409 Longest Palindrome
class Solution(object):
    def longestPalindrome(self, s):
        """
        :type s: str
        :rtype: int
        """
        dict = {}
        for i in s:
            dict[i] = dict.get(i, 0) + 1
        total = 0
        firstOdd = True
        for key, val in dict.items():
            if val % 2 == 0:
                total += val
            elif firstOdd:
                total += val
                firstOdd = False
            else:
                total += val - 1
        return total

