# 303. Range Sum Query - Immutable
class NumArray(object):
    def __init__(self, nums):
        """
        :type nums: List[int]
        """
        self.nums, self.cdf, cumSum = nums, [], 0
        for i in self.nums:
            cumSum += i
            self.cdf.append(cumSum)

    def sumRange(self, i, j):
        """
        :type i: int
        :type j: int
        :rtype: int
        """
        return self.cdf[j] - self.cdf[i] + self.nums[j]

