class Solution(object):
    def merge(self, nums1, m, nums2, n):
        """
        :type nums1: List[int]
        :type m: int
        :type nums2: List[int]
        :type n: int
        :rtype: void Do not return anything, modify nums1 in-place instead.
        """
        if m == 0 and n > 0: nums1[:n] = nums2[:]
        if m > 0 and n > 0:
            i, j, k = m-1, n-1, m+n-1
            while i > -1 and j > -1:
                if nums1[i] > nums2[j]:
                    nums1[k] = nums1[i]
                    i, k = i-1, k-1
                else:
                    nums1[k] = nums2[j]
                    j, k = j-1, k-1
            if i == -1:
                nums1[:k+1] = nums2[:j+1]
            if j == -1:
                nums1[:k+1] = nums1[:i+1]

