        for char in p: d_p[char] = d_p.get(char, 0) + 1
        for char in s[:n_p]: d_s[char] = d_s.get(char, 0) + 1
        for i in range(n_s-n_p+1):
            if d_s == d_p: rslt.append(i)
            d_s[s[i]] -= 1
            if d_s[s[i]] == 0: del d_s[s[i]]
            if i < n_s-n_p:
                d_s[s[i+n_p]] = d_s.get(s[i+n_p], 0) + 1
        else:
            if d_s == d_p: rslt.append(i)
        return rslt

