class Solution(object):
    def findPairs(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        d, n = set(), len(nums)
        if n < 2: return 0
        for i in range(n-1):
            for j in range(i+1, n):
                a, b = nums[i], nums[j] if nums[i] >= nums[j] else nums[j], nums[i]
