        """
        :type root: TreeNode
        :rtype: int
        """
        def f(root, flag):
            if root is None: return 0
            if root.left is None and root.right is None:
                if flag:
                    return root.val
                else:
                    return 0
            return f(root.left, True) + f(root.right, False)
        
