class Solution(object):
    def findMin(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        i = 0
        j = len(nums) - 1
        while i < j:
            m = (j + i)//2
            if nums[m] < nums[j]:
                j = m
            else:
                i = m + 1
        return nums[i]

