class Solution(object):
    def rotate(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: void Do not return anything, modify nums in-place instead.
        """
        n = len(nums)
        nums[:] = nums[-(k%n):] + nums[:-(k%n)]  
        # nums = nums[-k:] + nums[:-k]
    
    def rotate2(self, nums, k):
        nums.reverse()
        k = k % len(nums)
        nums[:k] = nums[:k][::-1]
        nums[k:] = nums[k:][::-1]


