class Solution(object):
    def removeDuplicates(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        if len(nums) == 0: return 0
        i = j = 0
        m, n = 1, len(nums)
        while i < n:
            if nums[i] != nums[j]:
                nums[m] = nums[i]
                m += 1
                j = i
            i += 1
        return m

    def removeDuplicates2(self, nums):
        n = len(nums)
        if n < 2: return n
        i, m = 1, 1
        while i < n:
            if nums[i] != nums[i-1]:
                nums[m] = nums[i]
                m += 1
            i += 1
        return m

