# 525. Contiguous Array
class Solution(object):
    def findMaxLength(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        d = {0: 0}
        key, maxL = 0, 0
        for i in range(len(nums)):
            key += nums[i] or -1
            if key not in d:
                d[key] = i+1  # Make index 1-based
            else:
                maxL = max(maxL, i+1-d[key])
        return maxL

